use cli_test_dir::*;

const BIN: &'static str = "./main";

#[test]
fn sample1() {
    let testdir = TestDir::new(BIN, "");
    let output = testdir
        .cmd()
        .output_with_stdin(
            r#"3
3 5 2
26
"#,
        )
        .tee_output()
        .expect_success();
    assert_eq!(output.stdout_str(), "8\n");
    assert!(output.stderr_str().is_empty());
}

#[test]
fn sample2() {
    let testdir = TestDir::new(BIN, "");
    let output = testdir
        .cmd()
        .output_with_stdin(
            r#"4
12 34 56 78
1000
"#,
        )
        .tee_output()
        .expect_success();
    assert_eq!(output.stdout_str(), "23\n");
    assert!(output.stderr_str().is_empty());
}

#[test]
fn sample3() {
    let testdir = TestDir::new(BIN, "");
    let output = testdir
        .cmd()
        .output_with_stdin(
            r#"1
1
1000000000000000000
"#,
        )
        .tee_output()
        .expect_success();
    assert_eq!(output.stdout_str(), "1000000000000000001\n");
    assert!(output.stderr_str().is_empty());
}

